'    //apex.event.trigger(document,''saveEmployee'');',
'}   ',
'',
'function saveEmployeeMappingDetails() {',
'    $("#employee_mapping_save").click();',
'}   ',
'',
'function printEmployeeReport() {',
'    $("#print_report").click();',
'}'))
,p_javascript_code_onload=>wwv_flow_string.join(wwv_flow_t_varchar2(
'// apex.actions.add({',
'//     name: "employee-save",',
'//     action: saveEmployeeDetails',
'// });',
'',
'// apex.actions.add({',
'//     name: "employee-mapping-save",',
