'// apex.actions.addShortcut("Alt+M","employee-mapping-save");',
'',
'',
'const saveEmployee = ',
'{',
'   name: "employee-save",',
'   action: saveEmployeeDetails,',
'   shortcut: "Alt+S"',
'}',
'',
'const mapEmployee = ',
'{',
'   name: "employee-mapping-save",',
'   action: saveEmployeeMappingDetails,',
'   shortcut: "Alt+M"',
'}',
'',
'const printReport = ',
'{',
'   name: "print-employee-report",',
